<?phpnamespace AtlantisGroup\OrmAG\DataMapper;class Generic extends AbstractDataMapper{    /**     *     * @param string $wrapperClassName     * @return Generic     */    public function setWrapperClassName($wrapperClassName)    {        $this->wrapperClassName = $wrapperClassName;        return $this;    }    /**     *     * @param string $entityClassName     * @return Generic     */    public function setEntityClassName($entityClassName)    {        $this->entityClassName = $entityClassName;        return $this;    }}